import logo from './logo.png';
import StaysData from './stays.json'
import './App.css';

function Stays() {
  return (
    <div className="Stays">
      <img src={StaysData[0].photo} className="Stay-picture" alt="Stay Picture" />
      <div className="Stay-Features">
        <p>{StaysData[0].superHost}</p>
        <p>{StaysData[0].type}</p>
        <p>{StaysData[0].beds}</p>
        <p>{StaysData[0].rating}</p>
      </div>
      <p>{StaysData[0].title}</p>
    </div>
  );
}

export default function Home() {
  return(
    <div>
      <div className="Home">
        <header className="Home-header">
          <img src={logo} className="Home-logo" alt="logo" />
            <p>
              Seabnb
            </p>
        </header>
      </div>
      <Stays />
    </div>
  );
};
